INSERT INTO `applications` VALUES (1,'Jonas','Craig','Male','1986-01-30','jonascraig86@gmail.com','0424629720','62 Joseph Street','Margate','Australia','Queensland',4019,0,'10083871',0,'Hella Craig','0416780182','','QUT Guild',5,2,5,1,1,2,1,'I enjoy a team sport activity like rock climbing because its chelalanging and fun to meet new people.','A',200,'2018-03-03'),(2,'Devin','McCullough','Female','1993-10-25','devinjmcc@gmail.com','0423837787','32/40 Boundary Street','South Brisbane','Australia','Queensland',4101,5,NULL,NULL,'Aneeta Antony','0413785670','$H$9z9i6LD6f4BrqAar7nD8NOTpDfOTYH.','word of mouth',NULL,0,2,1,0,3,3,'I recently got into climbing at Urban Climb and would love to transition to outdoor climbing. Marcus told me about you guys, brought me along to Open Day, and I loved it! Id love to join an organization where I can meet new people, climb, and learn new skills. From what I heard, Cliffhangers is the perfect place for that ','A',-20,'2018-03-03'),(3,'Lai Siu','Ho','Male','1996-09-09','laisiu.ho@connect.qut.edu.au','0468864501','Anderson Street','Kangaroo point','Australia','Queensland',4169,1,'9584820',1,'Stephen Ho','+852 93564247','$H$9F8tcidpLvIVTkCBDu6/bKHNGNbXYu/','facebook',3,1,1,0,2,2,2,'Keen for fun :)','D',80,'2018-03-04'),(5,'Christian','Dreifuerst','Male','1996-06-29','christian.dreifuerst@t-online.de','0421137696','20 Mowbray Terrace','East Brisbane','Australia','Queensland',4169,0,'0',1,'Marion Dreifuerst','004917680638115','','facebook',1,0,0,0,1,3,3,'It is fun :)','A',70,'2018-03-04'),(6,'Sarah','George','Female','2000-07-14','sarah.george@hotmail.com.au','0431001929','Amy St','Hawthorne','Australia','Queensland',4171,0,'10208348',0,'Brenda George ','0427995568','$H$9CN681Mq0s8bfVjAw//uRpApv/j0Uo1','O week',10,2,0,0,1,2,1,'I really enjoy climbing and would love to become more immersed in the sport.','A',160,'2018-03-04'),(7,'Raechelle','Gilmour','Female','1999-11-15','raechelle.gilly@outlook.com','0452494257','14 Travolta St','Stafford Heights','Australia','Queensland',4053,0,'10217991',0,'Jan Gilmour','0417076362','$H$92LF4X.ZwqvbFR6lFkcHBUEXfzM3Hj1','O week',10,2,0,1,1,2,2,'I came along to the open day to try climbing out and I really enjoyed it. I hadn\'t done any outdoor climbing before and after trying it I want to do more of it. I also liked how friendly and open everyone was and I would like to become part of that community','A',180,'2018-03-04'),(8,'Brittany','Radbone','Female','1998-07-23','brittyradbone@hotmail.com','0437799981','Macquarie street','Teneriffe','Australia','Queensland',4005,0,'10186000',0,'Alina Radbone','0418828025','$H$9tgd3ohsaDCJ.S7gN7EsrztCwiL8Hp1','QUT Guild',5,2,2,1,0,2,2,'I really love climbing, but so far I have only done indoor climbing and I have no idea how to go about doing outdoor climbing. I think Cliffhangers would be a really great way to get into some outdoor climbing and also to meet new people (given I just started at qut!)','A',180,'2018-03-04'),(9,'Jarret','Venderley','Male','1997-06-03','jarretvenderley@yahoo.com','0448555935','88 Windsor Road','Red Hill','Australia','Queensland',4059,1,'9492909',0,'Chris','0427580637','$H$9ErzukZ0XonXnWdIqbPRowlsyDtdMl.','O week',3,2,0,0,1,2,0,'According to my experience on the open day rock climbing is very challenging, but also rewarding. I\'m always up for a challenge and a reason for motivation to improve myself. The cliffhangers club also looks very organized and active which is an important consideration I made when looking to join. ','A',160,'2018-03-04'),(10,'Robert','Barfuss','Male','1991-09-29','n10103741@qut.edu.au','+61491078008','18 Eskgrove Street','East Brisbane','Australia','Queensland',4169,1,'10103741',1,'Franziska Barfuss','+491724183615','$H$98e476GmvRrHPQUbEbreba/vxbOFN90','search engine',1,0,2,0,1,2,2,'Last summer i climbed a fixed rope route in the Alps during my holidays. It was really exciting, so i decided to improve my climbing skills since then. Back in germany i attended two climbing courses, one to learn how to climb and secure toprobe and the other one to improve my technique. During my study time in Brisbane I want to learn something about rock climbing and of course I\'m willing to support the club.','A',70,'2018-03-04'),(11,'Patrick','Fordham','Male','1998-04-03','pat.fordham16@gmail.com','0411835426','Regent Street','Woolloongabba ','Australia','Queensland',4102,0,'1019628501',0,'Peter Fordham','0425289150','$H$9Q./MpMqNzADPXoXhFA2ur.7cM1ZnV.','QUT Guild',8,2,4,1,1,1,1,'I have always been interested and keen on outdoor activities from a young age. In the past I\'ve been involved in abseiling, canyoning, rockclimbing activities and weekends away and I have loved every minute of them. It\'s also a great form of exercise and one I am pretty passionate about. \r\n','A',180,'2018-03-04'),(12,'Katie','Rudnik','Female','1994-10-29','krudnik@email.sc.edu','+12819482013','49 Baines Street','Kangaroo Point','Australia','Queensland',4169,1,'10157867',1,'Sharron Rudnik','2819482889','$H$9TLZtZbC0dO8sLWCiQigxwh8sTMRPy/','O week',1,0,0,0,1,3,1,'I\'ve been indoor rock climbing just a couple times back home and really have enjoyed it so I\'m excited about the opportunity to try a different kind of climbing and meet some cool people at the same time! I\'m from the US and only here for a semester, but I want to make the most of my time here and I think this club is a great way to do so. \r\n\r\n(as for the question about volunteering to set up the ropes - I chose \"one night\" but I\'m happy to help any time I am there. I live in Kangaroo Point and don\'t have classes on Mondays or in the evening on Wednesdays, so I assume I can come help/climb pretty much all the time unless I\'m traveling for a long weekend and missing Monday, which won\'t be that often.)','A',70,'2018-03-04'),(13,'Jostein','Haavik','Male','1993-12-08','jostein.haavik@live.no','0450513562','20 Jump Street','Petrie Terrace','Australia','Queensland',4000,1,'10153985',1,'Håkon Børs-Lind','0450514275','$H$95ZBaLolS4w71hzMT3kUnsLvxbc1p11','O week',1,0,3,0,0,2,2,'I want to join the Cliffhangers because in the recent years I have been more and more interested in climbing. I have mostly been bouldering, but also done some indoor climbing with both top rope and lead climbing. I want to improve my skills in climbing and at the same time meet people who are interested in the same things that I am, and also I would just like to have a good time. As I am a exchange student I am also very interested in going on trips and checking out different spots around Queensland. ','A',70,'2018-03-04'),(14,'Irene','Schwartz','Female','1995-01-24','irene.schwartz@uncnet.net','0450642440','60 Bell St','Kangaroo Point','Australia','Queensland',4169,0,'10089497',1,'Matthias Gerlitz','+43 6888223608','$H$9C6JuVt3pULdzuhJ1YhqiCL665WrBP/','facebook',1,0,1,0,2,2,0,'Amazing climbing oppertunity in the city, outdoor rock climbing experience, meet nice people','D',40,'2018-03-04'),(15,'Jane','Callan','Female','1998-10-21','janecallan@live.com.au','0439592671','Goodwin Terrace','Moorooka','Australia','Queensland',4105,1,'9749691',0,'Grace Callan','0439254330','$H$9EaNeKN.1zMb.sM1oWUbYnGixiuaoq0','word of mouth',4,0,0,1,1,2,1,'Been dreaming of climbing those big cliffs since I first laid my eyes on them, I\'ve just never had the resources to do it. Third year para/nursing student here, would like to get involved before it\'s too late. Climbing looks like a blast, keen to build up a little strength and stamina and meet new people outside of my own health industry bubble. Cheers, hope to meet yas at the rocks. ','A',110,'2018-03-04'),(16,'Claire','Long','Female','1994-12-14','claireemily94@gmail.com','0468889894','Norman avenue ','Norman Park ','Australia','Queensland',4170,0,'10249044',0,'Dan farren ','0466696788','$H$967c8xVKMY6s/DsBb3UWYsAb1YuiyB1','facebook',7,2,2,1,1,3,3,'I am super keen to join cliffhangers! I\'ve been doing indoor bouldering/top roping at urban climb for the past year and have been eager to have a crack at outside! So I saw this as the perfect opportunity to learn how to do outdoors! ','A',180,'2018-03-04'),(17,'Dale','Williamson','Male','1998-07-30','dale.williamson@hotmail.com','0416109207','64 Cook Street','Northgate','Australia','Queensland',4013,1,'9729178',0,'Richard Williamson','0417792847','$H$9gT3dFpFuPerkqBPfNS2C00DqZst5E0','QUT Guild',6,2,2,1,1,3,2,'I am interested in climbing every Monday night at KP to improve my strength/fitness but to also challenge myself to take climbing beyond the indoors. I would also love the opportunity to see a different/more challenging side to the mountains around South-East Queensland - mountains I have climbed/hiked numerous times on foot.','A',180,'2018-03-04'),(18,'James','Wiseman','Male','1995-08-21','jamesharrywiseman@hotmail.com','0432514089','7 abingdon st.','Woolloongabba ','Australia','Queensland',4102,1,'8850101',0,'Tracey Wiseman','0421344863','$H$9uO7GB3fgwKHkwtrKBY4O112AbVl/r.','O week',2,1,0,0,1,0,1,'I love the outdoors and adrenaline rushes. A friend told me that rick climbing is an epic mix of both so I decided to get involved with you guys.','A',100,'2018-03-04'),(19,'Will','Chan','Male','1988-06-11','will2125@tpg.com.au','0400588627','2 Waverley Road, 40','Taringa','Australia','Queensland',4068,2,NULL,NULL,'Kylie Chan','0400588628','$H$9QNRr6PtSMo1MZGpg2rLJY.Ua8IiON/','ongoing/lapsed member',NULL,2,6,1,2,1,1,'','A',120,'2018-03-04'),(20,'Jenny','Hsieh','Female','1981-10-02','chia_wei_hsieh@yahoo.com.tw','0411892518','29 Parklands Street','Calamvale','Australia','Queensland',4116,2,NULL,NULL,'Sally','0401053040','$H$9FxtXuliF/3JTXB639uVmhBIvU3CSP1','word of mouth',NULL,2,2,1,2,1,0,'I would like to advance my skills in climbing by exposing myself to the environment (people with same interest, going to different places to climb, climbing more often...etc)','A',90,'2018-03-04'),(21,'Jose',' Mangalindan','Male','1993-08-29','josepaulo.mangalindan@connect.qut.edu.au','0432