angers will be a great experience in my first year of uni, and hopefully the years that follow','A',160,'2018-03-04'),(25,'Caitlyn','Saltmarsh','Female','1995-06-07','caitlynsaltmarsh@gmail.com','0488060705','Ardentallen, 10, Court','Enoggera','Australia','Queensland',4051,1,'8858322',0,'Rebecca','0400793070','$H$9EkeXkCaNg5jKYA1D9TscCcNjhFeCx0','word of mouth',2,2,3,1,1,2,2,'I\'ve been indoor climbing for just over a year, with some small experience in outdoor top roping. I love trail running, hiking and every outdoor adventure in between and I\'m keen to meet people that enjoy the same. I\'m hoping that this will help to broaden my climbing experience and that I can learn from your gang. I\'d describe myself as being fairly low-key and a huge dork with a terrible sense of humour. Looking forward to hearing from you! (Also, Jess, the new website is killer - good job!).','A',170,'2018-03-04'),(26,'Matt','Thompson','Male','1972-08-10','matzmail@gmail.com','61432868686','6 Rosslyn Street','East Brisbane','Australia','Queensland',4169,2,NULL,NULL,'Larissa Bligh','0431932072','$H$9fZ1FJNYCP7Bmjax/cgrHFlCnm2g2v0','word of mouth',NULL,2,4,1,0,3,1,'Keen! I have rope access and rigging qualifications, Im building 2 ziplines and enjoy social climbing and although my climbing ability is novice I have a good understanding of risk management and enjoy learning and helping others. Cheers, Matt','A',120,'2018-03-04'),(27,'dilsher','batth','Male','1998-01-08','dilsher.singh18@yahoo.com','+61451000062','2 parkhurst place','kuraby','Australia','Queensland',4112,1,'9755551',1,'garry','0414322111','$H$9IwP88lYPOp6sP3biMg1xRYRiO850R1','word of mouth',8,2,0,0,1,1,0,'I tried rockclimbing on the open day. I really enjoyed it. And i thought this is something i would love to.','A',160,'2018-03-04'),(28,'Pablo','Martin Cueva','Male','1981-04-07','martincueva@connect.qut.edu.au','0401216615','29 Parklands Street','Calamvale','Australia','Queensland',4116,2,NULL,NULL,'Jenny','0411892518','$H$9tWgbD6/3YX5nekQWniQ2aUDnY1VDP1','QUT Guild',NULL,2,0,1,1,2,1,'I do a lot of hiking and trekking. Ive always wanted to initiate myself into climbing. It would be great to do it with cliffhangers. Cheers','A',120,'2018-03-04'),(29,'Bianca','Banchetti','Female','1993-10-18','biancabanchetti@gmail.com','0402774178','Unit 1 38 Eighth Avenue','Cooparoo','Australia','Queensland',4151,1,'08796734',0,'Deborah Banchetti','0414179991','$H$9nEC2LbDZtnh2hAuEEZNHf2ueBXREz/','O week',2,1,3,0,2,1,3,'I love the outdoors, I love a physical challenge and I love making new friends. QUT Cliffhangers combines all my \'loves\' so no doubt I am going to love being apart of this club. I\'m joining with a friend and both have us have been meaning to join for a long time. Looking forward to cultivating a new hobby and enjoying and making new friends, as well as bringing new ones along on the way! ','A',70,'2018-03-04'),(30,'Caitlin','Archbold','Female','1994-12-13','caitlinearchbold@gmail.com','0408477212','Indooroopilly Rd','Taringa','Australia','Queensland',4068,1,'8586161',0,'Anne Archbold','0418192731','$H$9MLhHZsj6BK.deOuziEqXANhQPcuPY/','word of mouth',3,1,2,1,1,2,1,'I\'ve done a bit of climbing before in my first year of uni and loved it! I\'ve done a few climbs sporadically since then, but would love to get more into it and build my skills. It\'s so satisfying getting to the top of a climb and a super fun way to keep fit. I also love the outdoors and the possibility of weekend camping trips, and getting to know like-minded people. ','A',130,'2018-03-04'),(31,'Nikolay','Labukov','Male','1998-01-09','lab_nik@outlook.com','0439268970','4 Lynette Street','Bracken Ridge','Australia','Queensland',4017,1,'9356011',0,'Fred Labukov','0439669267','$H$9f5CxZ5Jmg5sly9AtltflYIGQbLxj40','word of mouth',5,2,2,0,1,1,0,'I\'m a lean mean fighting machine who keen to decimate cliffs and work as a team.','A',160,'2018-03-04'),(32,'Mackenzi','Oliver','Female','1999-09-16','mackenzioliver@outlook.com','04