ngly recommended me to join this awesome climbing society \'Cliffhangers\'. Through being an active member in this club, whether it be attending/helping set up top ropes at KP or planning/attending weekend trips, I wish to meet copious amounts of like minded people and from this I believe my climbing will improve and my friendship base will grow. ','A',160,'2018-03-12'),(37,'TAIKI ','FUJITANI ','Male','1996-12-13','1213taiki@gmail.com','0422676526','Hanworth','East Brisbane ','Australia','Queensland',4169,5,NULL,NULL,'Yukie fujitani','09054477525','$H$9wiKbATRnwX.PdWJmvpRCE.3Ji/qNT1','facebook',NULL,0,0,0,2,0,0,'','D',-70,'2018-03-12'),(38,'Kalinda','Cheuny','Female','1999-05-19','n10244336@qut.edu.au','0452525519','Ann','Brisbane city','Australia','Queensland',4000,1,'10233446',0,'Nelson','0488991358','$H$9o.drOSzQ64SFfxNoyMxwBsa1w4Jjc1','search engine',7,2,3,0,1,3,0,'I generally enjoy the challenges and the spirit of rock climbing and would like to learn some new skills. ','A',160,'2018-03-13'),(39,'Michael','Osachy','Male','1995-03-01','michael.osachy@connect.qut.edu.au','0421880039','26 Moreton St, 3','Norman Park','Australia','Queensland',4710,1,'8877688',0,'Wally','0403715121','$H$9xAuds0tXvOimwbsdGa1RC3axIn2vf0','ongoing/lapsed member',1,2,6,1,1,2,3,'','A',190,'2018-03-13'),(40,'Helena','Horton','Female','1996-03-27','helena.horton6@gmail.com','0434797100','2/58 Baron St','Greenslopes','Australia','Queensland',4120,2,NULL,NULL,'Phillipa Horton','0403485090','$H$9RTNPlVFNP.Poojcfb4kY2h.thn7oF0','word of mouth',NULL,2,2,1,1,2,2,'I\'ve been doing heaps of indoor rock climbing and hiking but I\'m really keen to get into outdoor climbing to learn some of those skills. I also have a couple of friends already part of the Cliffhangers and would like to go on the trips along with them.','A',120,'2018-03-13'),(41,'James','Clare','Male','2000-11-05','jcjamescclare@gmail.com','0448666658','60 Tribune Street, Room 104B','South Brisbane','Australia','Queensland',4101,0,'10