INSERT INTO `trips` VALUES (6,'Post Basic Skills Day Candy Mountain','<p> We\'re going to Candy Mountain Cliffhangers! It\'s time to put all those skills you learnt at the Basic Skills Day to good use, with some rockclimbing away from KP. </p>\r\n\r\n<p> This afternoon crag at Mt Tibrogargan is quite new, which only finished development just before christmas 2013, and is dominated by relatively easy sport routes. This crag is perfect for new climbers to come along and try out climbing away from Kangaroo Point. We\'ll also need as many leaders as possible to ensure this works! Mozzies own this crag, so a bath in insect repellent wouldn\'t go astray. </p>\r\n\r\n<p> Meet at the lookout at Kangaroo Point at 8:45am for a 9:00am departure. We will be meeting at the climbers carpark for gear distribution. Transport allocations will be sent closer to the date.The guide can be found <a href=\"https://www.thecrag.com/climbing/australia/glasshouse-mountains/area/405391497\"> here</a>, and I\'d suggest looking at it, as I doubt there\'s many people that know area well. </p>\r\n\r\n<p> The approach is described as, \"From the climber\'s car park, follow the right hand branch of the trail around the base of the mountain. Follow the trail for about 15 minutes. You will pass a set of benches at a lookout and then walk up a set of stairs. At the top of the stairs there\'s a path leading up to the left. Follow this path for 50 meters or so and arrive at the base of the cliff.\" <p>\r\n\r\n<h4>Gear:</h4> \r\nFor this trip only, request the gear you need in your reply to this thread. If you don\'t own any climbing gear, request a \"seconder kit\" which includes everything you will need to climb on the day:\r\n<ul>\r\n<li>a harness</li>\r\n<li> a helmet </li>\r\n<li>2 x safety slings</li>\r\n<li> belay device </li>\r\n<li> prusik cords + biners </li>\n</ul>\r\n\r\n<p> If you already own some of these items, only specify the individual items which you need to borrow. There are a limited number of seconder kits so be sure to get in quick. </p>\r\n\r\n<p> Note that this method of requesting gear is an exception to the norm. For other trips, you will be required to request gear from one of our quartermasters. </p>\r\n\r\n<p> Other essentials are lunch and plenty of water. Passengers, please give your driver $5 each way to contribute to fuel costs. </p>\r\n\r\n<p> Hopefully you have signed up as a paid member and signed so you can sign up below. </p>\r\n','2018-03-11',NULL,0,'Candy Mountain','2018-03-10'),(7,'Caves Route - Date Changed','<p>After the awesome Sunday at Andromeda, I\'m sure you\'re all raring for another trip to the Glass House Mountains. Well here\'s your chance...</p>\r\n\r\n<p>On Saturday we will be heading to Mt Tibrogargan to climb the Caves Route, a classic 300m ascent up the east face of Tibro. </p>\r\n\r\n<p><b>Difficulty:</b> It\'s a super easy grade 4 climb that anyone can do so don\'t be put off by thinking your not ready for it, and the views are spectacular. This trip is a great way to get into climbing in the great outdoors, and is a must do for any new members of the club! </p>\r\n\r\nYou can find more information <a href=\'https://www.thecrag.com/climbing/australia/glasshouse-mountains/tibrogargan/area/12229027\'>here.</a>\r\n\r\n<p><b>Transport:</b> We will depart from Kangaroo Point at the central lookout, at 7:30am on the dot. So aim to be there by 7:15am to give us time to sort everything out. The drive is a little less than an hour. \r\nAs long as we don\'t get too sidetracked well be off the mountain by dark. </p>\r\n\r\n<h4>Gear: </h4>\r\nWhat you need to bring will be:\r\n- Helmet\r\n- Harness\r\n- Belay Device\r\n- Safeties\r\n- Prussik\r\n<p>If you don\'t have any of the above things make sure you get in contact with the Quartermasters (Aaron & Andrew) at least 2 KP sessions before the trip, this will allow for collection time.</p>\r\n\r\n<p>- At least 1-2L of water\r\n- Some light snacks\r\n- Rain jacket (incase we decide to battle the weather)\r\n- Sunscreen\r\n- Head torch (we may be out at dusk, phone torch may suffice but wont be helpful when you need to use your hands.\r\n- Pub meal money</p>\r\n\r\n<p>Rock climbing shoes are not essential, but you\'ll want to bring decent shoes with you (thongs perhaps aren\'t a smart idea)</p>\r\n\r\n<p>There\'s also an expected fuel contribution of $5 each way for your drivers. Try to pay them before the end of the day, as people won\'t continue to drive places if they have to pay for all the fuel themselves.</p>\r\n\r\n<p>So, if you want to join us on this awesome trip, sign up below. Sign-ups strictly close Thursday 15/3 at 8pm. Transport will be posted shortly after.</p>\r\n','2018-03-17',NULL,0,'Tibro','2018-03-15'),(8,'Tinbeerwah','<p>Tinbeerwah is a mountain west of Noosa which boasts a large number of long slabby sport routes with a good spread of grades from about 13 to 21 (and a couple of harder routes with overhangs) making this a great spot for beginners. Check out the climbs <a href=\"https://www.thecrag.com/climbing/australia/mt-tinbeerwah\">here</a> </p>\r\n\r\n<p><b>Leaders:</b> remember to bring bolt plates, gear for top belays and a head for slab. According to the crag, most of the climbs on the crag require 7 to 11 plates.</p>\r\n\r\n<h4>Transport </h4>\r\n<p>Car pooling will be organised after signup closes. Unless you have made other arrangements with your driver/passengers, meet at 7:15 at the KP lookout for a 7:30am sharp departure, aiming for arrival at the car park at around 9:30am. </p>\r\n\r\n<h4>Gear</h4>\r\n<p>If you don\'t have a harness, helmet or other necessary climbing gear, you must organise to borrow club gear from a Quartermaster (Aaron Kho or Andrew Banks) by the Wednesday prior to the trip. Those without gear should request a seconder kit which contains a harness, helmet etc... There are a limited number of seconder kits so be sure to get in quick.</p>\r\n\r\n<p>Other essentials are lunch and plenty of water (3L recommended). Passengers, please give your driver $7.50 each way to contribute to fuel costs. Be sure to bring insect repellent to this crag!</p>\r\n\r\nSign up below!\r\n','2018-03-25',NULL,0,'Tinbeerwah','2018-03-23'),(9,'EASTER BROOYAR','<p>This is definitely our biggest and best camping trip of the year, you do not want to miss this!\r\nFor a little background, Brooyar is the club\'s closer home away from home, for when we canít get down to the Blue Mountains but want to rip ourselves up on some sandstone and have a great time with mates. The climbing area is located in the Brooyar State Forest North west of Gympie, which is about a 2.5 hour drive from Brisbane.</p>\r\n\r\n<p><b>When</b></br>\r\nThe plan is to drive up in the afternoon/evening of Thursday 13th, returning on the afternoon of Monday 17th. Please state in your sign-up post if you will be attending for the entire trip, or only for specific dates. If you are flexible with arrival/departure dates, please say so as this may help us to plan carpooling.<p>\r\n\r\n<p><b>Climbs</b></br>\r\nThere are several beautiful sandstone crags offering a wide range of climbing styles and grades, ensuring there is something for everyone! The climbing quality is great, and you\'ll never look at KP the same way again once you\'ve climbed here. Styles include everything from slab to overhung and face climbing. Check out the Crag <a href=\'https://www.thecrag.com/climbing/australia/brooyar\'>here </a>and get those tick lists started.</p>\r\n\r\n<p><b>Transport</b></br>\r\nCar pooling will be organised after signup closes. It will be up to you to organise pick ups in Brisbane with your driver/passengers. If you are a passenger on this trip you will need $20 fuel money ($10 each way) to give to your driver. <a href=\'https://goo.gl/maps/Y38Am4prsBq\'>Google maps link</a></p>\r\n\r\n<p><b>What to bring</b></p>\r\n\r\n<p>WATER: There is no drinking water at Brooyar, bring at least 3 litres for yourself per day.</p>\r\n\r\n<p>Camping gear: \n<ul>\n<li>tent </li>\n<li>sleeping bag (and mat)</li>\n<li>pillow</li> \n<li>cutlery, bowl, cup etc</li>\n</ul>\r\nIf you have them:\n<ul> \n<li>portable stove</li> \n<li>esky</li> \n<li>firewood</li>\n</ul>\nPlease organise your camping gear (tents, esky) in advance. If you have extra space in your tent, or other camping gear you are willing to lend, please mention it in your sign-up post so others requiring said gear can contact you about it.\n</p>\r\n\r\n<p>Climbing gear: \n<ul>\n<li>harness</li>\n<li>shoes</li>\n<li>belay device</li> \n<li>helmet</li> \n<li>safeties</li>\n</ul> \nat a bare minimum. If you need to borrow any gear, organise with Quartermasters Andrew and/or Aaron early on (at least two KP nights before the trip).</p>\r\n\r\n<p>Food: Enough food to sustain you for your entire trip. If you have an esky or are sharing an esky cold food is good, however if you don\'t own an esky then it is recommended that you bring dry food, and/or fruits and veg, nothing that needs to be cold and won\'t go off. It\'s club tradition to go to Pizza Hut in Gympie for all-you-can-eat dinner on one of the nights.</p>\r\n\r\n<p>Camping Permit: Hopefully we can organise whoppa\'s land to camp on, will keep you updated.</p>\r\n\r\n<p>Rubbish: Brooyar is pack it in, pack it out. There are no bins anywhere, so give some thought to minimising the amount of packaging you bring, and how you\'re going to carry it back out. (eg, re-usable containers instead of disposable plastic, cans instead of bottles, prepare food ahead to reduce waste, bring rubbish bags)</p>\r\n\r\n<p>Check out the Crag <a href=\'https://www.thecrag.com/climbing/australia/brooyar\'>here </a>and get those tick lists started.</p>\r\n\r\n<p><b>Sign up below</b></p>\r\n\n<div class=\"trip-images\">\r\n<img src=\"https://docs.google.com/uc?id=1lYoMVVVk4mJW1r2CpKrIHls96er-49a1\" alt=\"Issy Climbing\">\n<img src=\"https://docs.google.com/uc?id=1XvLw7jLDmwKsIKTqvhEg01-_fciAvopv\" alt=\"Brooyar sunrise\">\n<img src=\"https://docs.google.com/uc?id=1jlvogKzuzUpVUYx38qi2bzL64YNj4m33\" alt=\"Mima celluloid\">\n</div>','2018-03-29','2018-04-02',1,'Brooyar','2018-03-25');
